import React, { useState } from "react";
import Dashboard from "./components/Dashboard";
import FinanceiroDashboard from "./components/FinanceiroDashboard";

function App() {
  const [view, setView] = useState("hospital");

  return (
    <div style={{ padding: 20 }}>

      <div style={{ marginBottom: 30 }}>
        <button onClick={() => setView("hospital")}>Hospitalar</button>
        <button onClick={() => setView("financeiro")} style={{ marginLeft: 10 }}>
          Financeiro
        </button>
      </div>

      {view === "hospital" && <Dashboard />}
      {view === "financeiro" && <FinanceiroDashboard />}

    </div>
  );
}

export default App;
